import React from "react";

const ToDo = ({ itemName, onDelete }) => {
  onDeleteItem = () => {
    onDelete(itemName);
  };

  return (
    <div>
      <text>{itemName}</text>
      <button onClick={this.onDeleteItem}>done!</button>
    </div>
  );
};

export default ToDo;
